CREATE DEFINER=`root`@`localhost` PROCEDURE `classpEscEdadHombre`(p varchar(25), escIni int, escFin int, edadIni int, edadFin int)
begin
	begin
		drop table if exists clas;
    create temporary table clas(
		clasificacion int, frecuencia int default 0, porcentaje double, tiempo varchar(25) default 0
    ) engine = memory;
	
		drop table if exists resp;
        create temporary table resp(
			respuesta varchar(25), tiempo varchar(50), gramatica int
		) engine = memory ;
    begin
		
		declare aux int ;
		declare vb_termina bool default false;
        
		declare cr cursor for select idsujeto from sujeto2 where (esconlaridad between escIni and escFin) and (edad between edadIni and edadFin) and sexo = 0;
        declare continue handler for sqlstate '02000' set vb_termina = true;
        
    open cr;
    repeat
		FETCH cr into aux;
		insert into resp select respuesta, tiempo, gramatica from palabras.respuestas2 where palabraBase = p and idsujeto  = aux;
	until vb_termina end repeat;
    close cr;
    END ;
    
    drop table if exists pal;
		create temporary table pal ( 
			palabra varchar(50), frecuencia int, porcentaje double, tiemp varchar(50), gramatica int
		) engine = memory;
	
	insert into pal(palabra, gramatica) SELECT distinct (respuesta), gramatica from resp;
		begin 
			declare aux2 varchar(50) default '';
			declare vb_termina2 bool default false;
			declare timee2 varchar(25);
			declare total int default (select count(*) from sujeto2);
			declare x2 int default (select count(*) from resp);
			declare iguales2 int default 0;
			declare cr2 cursor for select palabra from pal;
			declare continue handler for sqlstate '02000' set vb_termina2 = true;
				
			open cr2;
			repeat
				FETCH cr2 into aux2;
				set iguales2 = (select count(*) from resp where respuesta = aux2 );
				set timee2 = (select SEC_TO_TIME(AVG(TIME_TO_SEC(tiempo))) from resp where respuesta = aux2);
				update pal
				set frecuencia = iguales2,
				porcentaje = ( iguales2 * 100) / x2,                
				tiemp =  substring(timee2, 7,5)
				where palabra = aux2;
				
			until vb_termina2 end repeat;
			close cr2;
		end;
		select palabra 'Palabra respuesta', frecuencia, porcentaje, tiemp, gramatica from pal order by frecuencia desc ;
	end ;
    begin
		
		declare aux1 varchar(50) default '';
		declare vb_termina1 bool default false;
        declare f2 int;
        declare t1 varchar(25);
        declare t2 varchar(25);
        declare gramac int;
		declare cr1 cursor for select distinct(palabra) from pal;
        declare continue handler for sqlstate '02000' set vb_termina1 = true;
        insert into clas(clasificacion) select distinct(gramatica) from pal;
        
    open cr1;
    repeat
		FETCH cr1 into aux1;
        set gramac = (select gramatica from pal where palabra = aux1 limit 1);
        set f2 = (select count(*) from pal where gramatica = gramac limit 1);
        set t1 = (select sum(tiemp) from pal where gramatica = gramac);
        update clas 
        set frecuencia  = f2,
        tiempo = t1
        where clasificacion = gramac;
	until vb_termina1 end repeat;
    close cr1;
    
    end;
    
    begin
		declare aux3 varchar(50) default '';
        declare tot int default (select sum(frecuencia) from clas);
        declare ccc int;
        declare ff int ;
        declare timeee varchar(25);
		declare vb_termina3 bool default false;
		declare cr3 cursor for select clasificacion from clas;
        declare continue handler for sqlstate '02000' set vb_termina3 = true;
        
    open cr3;
    repeat
		FETCH cr3 into aux3;
        set ff = (select frecuencia from clas where clasificacion = aux3);
        set timeee = (select tiempo from clas where clasificacion  = aux3);
		update clas
        set tiempo =  time_to_sec(timeee)/ ff,
        porcentaje = ((ff)*100.00)/tot
        where clasificacion = aux3;
	until vb_termina3 end repeat;
    close cr3;
    end;
	select * from clas order by clasificacion asc;
end ;;
