CREATE DEFINER=`root`@`localhost` PROCEDURE `cuenta`(p char(50))
begin
	begin

    drop table if exists pal;
		create temporary table pal ( 
			palabra varchar(50), frecuencia int, porcentaje double, tiemp varchar(25)
		) engine = memory;
	
	insert into pal(palabra) SELECT distinct palabras.respuestas.respuesta from palabras.respuestas where palabraBase = p;
    
    begin 
		declare aux varchar(50) default '';
		declare vb_termina bool default false;
        declare timee varchar(25);
        declare x int default (select count(*) from palabras.respuestas where palabraBase = p);
        declare iguales int default 0;
		declare cr cursor for select palabra from pal;
        declare continue handler for sqlstate '02000' set vb_termina = true;
        
    open cr;
    repeat
		FETCH cr into aux;
		set iguales = (select count(*) from palabras.respuestas where respuesta = aux and palabraBase = p);
        set timee = (select SEC_TO_TIME(AVG(TIME_TO_SEC(tiempo))) from palabras.respuestas where respuesta = aux and palabraBase = p );
        update pal
        set frecuencia = iguales,
        porcentaje = ( iguales * 100) / x,
        tiemp = substring(timee, 7,5)
        where palabra = aux;
        
	until vb_termina end repeat;
    close cr;
    end;
    
    select * from pal order by frecuencia desc ;
	end;
end ;;
